class unique_list(list):
    # def __init__(self):
    #     super().__init__()
    def append(self,item):
        if item in self:
            return
        super().append(item)   

def merge_the_tools(string, k):
    n = len(string)
    sub_max_len = k
    u_list = unique_list()
    count = 0
    ans = []
    for i in range(n):
        if(count<sub_max_len):
            u_list.append(string[i])
            count+=1
        if(count == sub_max_len):
            ans.append(u_list)
            u_list = unique_list()
            count = 0
    for i in ans:
        print("".join(i))
            

if __name__ == '__main__':
    string, k = "AABCAAADA", 3
    # string, k = "", 3452
    

    merge_the_tools(string, k)